import React from 'react'
import "./video.css"

function Video() {
  return (
    <div className='video'>
        <video 
            className='video_player'
            src="https://v16-webapp-prime.tiktok.com/video/tos/useast2a/tos-useast2a-ve-0068c002/o43IsVy2gzB4xkgHa6fnoMUhIACUIlcNCQAxq4/?a=1988&amp;ch=0&amp;cr=0&amp;dr=0&amp;lr=tiktok_m&amp;cd=0%7C0%7C1%7C0&amp;cv=1&amp;br=1086&amp;bt=543&amp;cs=0&amp;ds=3&amp;ft=_RwJrBiTq8Zmobw7Cc_vj8M_8AhLrus&amp;mime_type=video_mp4&amp;qs=0&amp;rc=NTw8aWZmZmYzNzw7NzU7ZkBpM2w5dzU6ZmhqaTMzNzczM0BgM142Mi1iX2AxYC9eYy9iYSNxLmpvcjQwYDBgLS1kMTZzcw%3D%3D&amp;btag=80000&amp;expire=1680157245&amp;l=202303300020363A9510E5EA50A383CCB4&amp;ply_type=2&amp;policy=2&amp;signature=3231eb599ec500917ae3e6b3415288bb&amp;tk=tt_chain_token"
        ></video>
        </div>
  )
}

export default Video
